import React from 'react'
import styled from 'styled-components';

export const HeroContainer = styled.div`
background: #2f2d2e;
display: flex;
width: 1920px;
height: 1080px;

padding: 128px 73.9px 604px 0;
object-fit: contain;
`

const Slogan = styled.div`
padding: 250.7px 992.2px 405.3px 247.8px

`
const SloganH1_1 = styled.h1`
    width: 680px;
    margin-bottom: 0px;
    font-family: Ubuntu;
    font-size: 110px;
    font-weight: bold;
    font-stretch: normal;
    font-style: normal;
    line-height: 1.36;
    letter-spacing: -4.4px;
    text-align: left;
    color: var(--black);
`
const SloganH1_2 = styled.h1`
width: 680px;
  font-family: Ubuntu;
  font-size: 110px;
  font-weight: bold;
  font-stretch: normal;
  font-style: normal;
  line-height: 1.36;
  letter-spacing: -4.4px;
  text-align: left;
  color: var(--black);
`

const HeroSection = () => {
    return (
        <>
            <HeroContainer>
                <Slogan>
                <SloganH1_1>
                    Paint        
                </SloganH1_1>
                <SloganH1_2>
                    Your Own Dot
                    On The World
                </SloganH1_2>
                </Slogan>
            </HeroContainer>
        </>
    )
}

export default HeroSection
